import { AppBar, styled, Toolbar } from '@mui/material'
import React from 'react'

const StyledToolbar = styled(Toolbar)({
 display:"flex",
 justifyContent:"space-between"
})

const Navbar = () => {
    return (
        <AppBar position="stick">
            <>
                 Navbar
            </>
            </AppBar>
    )
}

export default Navbar;
